function jfigsynstrmat(jata, jtitle)
    figure;
    subplot(1,17,1:14)
    clim = [-5, 5];
    clim = [min(min(jata(1:15,1:15))), max(max(jata(1:15,1:15)))];
    clim = [-1*max(max(abs(jata(1:15,1:15)))), max(max(abs(jata(1:15,1:15))))];
    clim = [-1*max(max(abs(jata(:)))), max(max(abs(jata(:))))];
    clim = [-1,1];
    imagesc(1:15,1:15,jata(1:15,1:15),clim);
    axis xy;
    set(gca,'FontSize',30,'fontWeight','bold');
    set(gca,'ytick',(0:5:15));
    set(gca,'yticklabel',(0:5:15));
    set(gca,'xtick',(0:5:15));
    set(gca,'xticklabel',(0:5:15));
    title(jtitle)
    subplot(1,17,15:17)
    %clim = [-1*max(max(abs(jata(16:17,:)))), max(max(abs(jata(16:17,:))))];
    if clim(2) == 0
        clim = [-1,1];
    end
    imagesc(1:1, 1:15, jata(16:17,:)',clim)
